	[TestFixture]
	class TestSageParser : BaseTestFixtue {
		[Test]
		public void TestToken() {
			var log = this.m_oLog;

			const string accessTokenRequest = "https://api.sageone.com" + "/oauth2/token" +
				"?grant_type=authorization_code" +
				"&code=ac5db1f2be1500f97da6f6a1b408734ff8c021c3" +
				"&redirect_uri=https://localhost:44300/Customer/SageMarketPlaces/SageCallback" +
				"&client_secret=lUuYVDVgr2LkN5whEVezncV3TwyXrYqXjgDaT49H" +
				"&client_id=IssYGGBRMb9f6cw7XJgpVaeiMbCNGcFAeyBysLvJ";

			var request = new RestRequest(Method.POST) { Resource = accessTokenRequest };
			request.AddHeader("Accept", "application/json");

			var client = new RestClient();

			string errorMessage = null;

			try {
				IRestResponse response = client.Execute(request);
				if (response != null) {
					var js = new JavaScriptSerializer();
					var deserializedResponse = (AccessTokenContainer)js.Deserialize(response.Content, typeof(AccessTokenContainer));

					if (deserializedResponse != null && deserializedResponse.access_token != null)
						return; // deserializedResponse;

					log.Error(
						"Failed parsing access token.\nRequest:{0}\nError msg: {2}\nResponse:{1}",
						request.Resource,
						response.Content,
						response.ErrorMessage
					);

					throw new Exception("Failed getting token but parsing didn't threw exception"); 
				}

				log.Error("SageOne response to token request is null.");
			}
			catch (Exception e) {
				errorMessage = "Failure getting access token";
				log.Warn(e, "{0}.", errorMessage);
			}
		}

